@Override
public long ramBytesUsed() {
  long size = 0;
  for (Map.Entry<String,DocValuesProducer> entry : formats.entrySet()) {
    size += (entry.getKey().length() * RamUsageEstimator.NUM_BYTES_CHAR) + 
        entry.getValue().ramBytesUsed();
  }
  return size;
}

